import { Link } from 'react-router-dom';

// const LinkArray = [
//     <Link to='/' > Home</Link >,
//     <Link to='/about'>About</Link>,
//     <Link to='/product'>Product</Link>
// ]
function LinkArray({ path, title }) {
    return (
        <Link to={path} > {title}</Link >
    )
}
export default LinkArray;
